import styled from 'styled-components';

const Container = styled.div`
	display: grid;
	grid-template-columns: 1fr 1fr 1fr;
	grid-template-rows: 1fr 1fr 1fr;
`;

const LogoStyle = styled.span`
	display: flex;
	align-items: center;
	margin: 2rem;
	img {
		height: 5rem;
		width: 5rem;
	}
`;

export { Container, LogoStyle };
